// Header.js
import {React, useState} from 'react';
import { Link } from 'react-router-dom';
import logo from '../images/logo_n.png';
import { Place, Person, ShoppingCart, Menu } from '@mui/icons-material';



function Header() {
  const [isVisible, setIsVisible] = useState(false);
    const openMenu = function () { 
      console.log('isVisible', isVisible);
    }


  return (
    <>
    <header>
      <nav className='desktop_menu'>
      <div className='logo'>
        <img src={logo} alt="main" />
      </div>
        <ul className='menu'>
          <li>
            <Link to="/fitness">FITNESS </Link>
          </li>  
          <li>
            <Link to="#">SPORTS</Link>
          </li>
          <li>
            <Link to="#">CARE</Link>
          </li>
          <li>
            <Link to="#">MIND</Link>
          </li>
          <li>
            <Link to="#">STORE</Link>
          </li>

        </ul>

      <ul className='menu_right'>
        <li>DELHI NCR <Place /></li>
        <li><Link to="#" className='get_app'>GET APP</Link></li>
        <li><Link to="#"><Person /></Link></li>
        <li><Link to="#"><ShoppingCart /></Link></li>

      </ul>
 </nav>



<div className='mobile_menu'>
<Menu className='menu_icon' />


</div>


    </header>
    <div>
      <button onClick={openMenu}>
        {isVisible ? 'Hide content' : 'Show content'}
      </button>
      {isVisible && (
        <div>
          <p>This is the content to show/hide.</p>
        </div>
      )}
    </div>

    </>
  );
}







export default Header;
